import React from 'react';

function PricingComp(props) {
    return (
        <div className = 'row mx-auto py-3' style = {{ width : "80%", minHeight : "400px" }}>
            <div className = 'card'>
                <h3 className = 'card-header'>{ props.pricingName }</h3>
                <h6 className = "card-subtitle text-muted">{ props.pricingExplain }</h6>

                <ul className = "list-group list-group-flush">
                    <li className = "list-group-item">便宜價: { props.lowPrice }</li>
                    <li className = "list-group-item">合理價: { props.resonablePrice }</li>
                    <li className = "list-group-item">昂貴價: { props.highPrice }</li>
                </ul>
            </div>
        </div>
    );
}

export default PricingComp;
